
const shawarmas = [
    { name: 'Класична', price: 60, img: 'https://images.pexels.com/photos/461198/pexels-photo-461198.jpeg' },
    { name: 'Гостра', price: 70, img: 'data:image/jpeg;base64,' },
    { name: 'З сиром', price: 80, img: 'data:image/jpeg;base64,' },
    { name: 'Вегетаріанська', price: 65, img: 'data:image/jpeg;base64,' },
    { name: 'М\'ясна', price: 90, img: 'data:image/jpeg;base64,' },
    { name: 'З овочами', price: 70, img: 'data:image/jpeg;base64,' }
];

const menu = document.getElementById('menu');
let cartCount = 0;
let totalPrice = 0;

function updateCart() {
    document.getElementById('cart-count').textContent = cartCount;
    document.getElementById('total-price').textContent = totalPrice;
}

shawarmas.forEach(item => {
    const div = document.createElement('div');
    div.classList.add('shawarma');
    div.innerHTML = `
        <img src="${item.img}" alt="${item.name}">
        <h3>${item.name}</h3>
        <p>${item.price} грн</p>
        <button>Додати</button>
    `;

    const btn = div.querySelector('button');
    btn.addEventListener('click', () => {
        cartCount++;
        totalPrice += item.price;

        // анімація кнопки
        btn.style.backgroundColor = '#fff';
        btn.style.color = '#ff4c00';
        btn.style.transform = 'scale(1.2)';
        setTimeout(() => {
            btn.style.backgroundColor = '';
            btn.style.color = '';
            btn.style.transform = '';
        }, 300);

        updateCart();
    });

    menu.appendChild(div);
});

updateCart();
